script: |
  super -f tsv -I q5985.sql | sort > q5985.out

vector: true

inputs:
  - name: q5985.sql
    data: |
      SELECT - 55 * + col2 + + col0 + + - col2 - - col0 * + col2 FROM tab1 AS cor0 GROUP BY col2, col0 HAVING + COUNT ( * ) + + CAST ( NULL AS INTEGER ) - + col2 / col0 IS NULL;
  - name: tab1

outputs:
  - name: q5985.out
    data: |
      -1232
      -250
      1928
